import { Box } from "@mui/material";
import "../css/navbar.css"

const NavBar = () => {
    return <div className="navbar-container">
            <Box
        component="img"
        src="https://sca.it/wp-content/uploads/2017/12/logo.jpg"
        alt="Immagine di esempio"
        sx={{
            width: "100%",
            maxWidth: 400,
            borderRadius: 4,
            boxShadow: 3,
        }}
        />
    </div>;
}

export default NavBar;
